INSERT INTO `Problema` (`idProblema`, `idTipo`, `Nombre`, `Archivo`, `Enunciado`, `idComplejidad`, `TiempoEjecucionMax`) VALUES
(1, 3, 'Suma de dos números', '7ae1a2c66f28ff205ea890d3e639bc5f.gif', 'Dados dos números enteros se debe devolver el resultado de la suma', 1, 5000),
(2, 1, 'Máximo', NULL, 'Dados dos números devolver el máximo de ambos', 1, 2000),
(3, 3, 'Área de Corona ', 'a48fee16262b89aef908eb37ad64adf1.jpeg', '¿Cuál es el área de una vereda en forma de corona circular, si el radio interior es r  y el radio exterior R?\r\nLa respuesta debe ser un número con dos decimales con punto \'.\' como separador decimal.\r\nSe fija la constante pi=3.1415926535898.', 1, 5000),
(4, 1, 'Área de Corazón', NULL, 'Hallar el área del siguiente corazón: diametro D, y diagonal d', 1, 2000),
(5, 2, 'Suma de múltiplos', NULL, 'Si listamos todos los números naturales menores que 10 que son múltiplos de 3 o 5 tenemos:\r\n3, 5, 6 y 9.  La suma de estos múltiplos es 23.\r\nSe requiere un programa que dado un número natulal N devuelva la suma de todos los múltiplos de 3 y los múltiplos de 5 menores que N.', 2, 5000),
(6, 2, 'Suma de los dígitos de un Factorial', NULL, 'n! = n × (n - 1) × ... × 3 × 2 × 1\r\n\r\nPor ejemplo, 10! = 10 × 9 × ... × 3 × 2 × 1 = 3628800,\r\ny si sumamos todos los dígitos del número 10! tenemos 3 + 6 + 2 + 8 + 8 + 0 + 0 = 27.\r\n\r\nSe requiere un programa que dado un número N devuelva la suma de los dígitos de N!.', 2, 5000),
(7, 2, 'Numeración de Perros', '7213dae0aaa61d6a2eb88f9fc2f4f833.jpg', 'Una señora tiene perros, y quiere asignarles como nombres a esos perros distintos enteros para poder identificarlos fácilmente. (Tiene buena memoria para números y mala para los nombres propios). Los perros han expresado sus preferencias a la señora. El i-ésimo perro quiere un entero entre 1 y maxNumber[i], inclusive. La señora debe obedecer las preferencias de todos sus perros. ¿De cuantas maneras distintas puede la señora asignar distintos números a sus perros?\r\n<br/>\r\nEntrada:\r\nLa entrada se dará según el siguiente formato: un número N que definira la cantidad de perros que tiene la señora (1 &le; N &le; 10).\r\nN números enteros, indicando cada uno el máximo número con el que le gustaría tener asignado separados por comas.(1 &le; maxNumber[i] &le; 30)\r\n<br/>\r\nSalida:\r\nImprimir un único número con el número de distintas combinaciones de números que podría usar la señora, tal que todos los perros tengan números distintos y cumpla con las preferencias de cada perro. (Si no hay combinaciones válidas, imprimir 0)<br/>\r\nEj Parametros entrada: 1,6 -> salida:6<br/>\r\nEj Parametros entrada: 2,5,8 -> salida:35<br/>', 3, 5000),
(8, 2, 'Divisores Comunes', NULL, 'Dados dos enteros A y B, con 0 < A < B < 2147483647 (2³¹), encontrar el número de divisores enteros positivos en común entre A y B.<br/>\r\nEj. parametros entrada: 5,15 -> salida:2<br/>\r\nEj. parametros entrada: 20,30 -> salida:4<br/>\r\n', 3, 5000),
(9, 3, 'Suma de 5 números', NULL, 'Dados cinco números enteros se debe devolver el resultado de la suma.', 1, 2000),
(10, 3, 'Promedio de 3 números', NULL, 'Dados tres números enteros se debe devolver el promedio.  En caso de que el resultado de un número con decimales redondear al entero más cercano.', 1, 2000),
(11, 3, 'Mayor de 3 números', NULL, 'Dados tres números devolver el máximo.', 2, 2000),
(12, 3, 'Paridad de un número', NULL, 'Dado un numero entero devolver, 1 en caso de ser impar y 0 en caso de ser par.', 2, 2000),
(13, 2, 'Días del año', NULL, 'Dados dos números enteros que identifican a un mes y un día retornar la cantidad de dias transcurridos en el año.  Asumir que el año no es bisiesto.<br/>\r\nEjemplo: Para (2,1) retorna 32=31+1; Para (3,4) retorna 63=31+28+4.', 2, 5000),
(14, 3, 'Cuadrado', NULL, 'Dado un valor mostrar el cuadrado de ese número. Por ej. si el número es 7 su cuadrado es 49. ', 1, 5000),
(15, 3, 'El Tiempo', NULL, 'Leer tres valores correspondientes a una hora, minutos y segundos, mostrar la cantidad de segundos que representan. Por ejemplo si se leyera 2 horas, 36 minutos, 10 segundos, el resultado a mostrar es: 9370', 2, 5000),
(16, 1, 'Dos Rectángulos', NULL, 'Dados 4 valores correspondientes a la base y altura de dos rectángulos, mostrar el área mayor.  (se ingresa base y altura del primer rectángulo y luego la base y altura del segundo)', 2, 5000),
(17, 3, 'Triángulo equilátero', NULL, 'Determinar el lado de un triángulo equilátero cuyo perímetro es igual al de un cuadrado de X cm de lado.<br/> Ejemplos. <br/> entrada: 2205 - salida: 2940 <br/> entrada: 1143 - salida: 1524 <br/> entrada 321 - salida 428\r\n', 2, 5000),
(18, 2, 'R01-Factorial', NULL, 'Mostrar el factorial (X!)de un número dado.<br/>\r\n0!=1<br/>\r\n1!=1<br/>\r\n2!=2*1!=2*1=2<br/>\r\n3!=3*2!=6<br/>\r\n...<br/>\r\nX!=X*(X-1)!<br/>\r\n', 1, 5000),
(19, 3, 'R02-Potencia', NULL, 'Dado dos valores correspondientes a una base y a un exponente, mostrar el valor correspondiente al cálculo de la potencia', 1, 5000),
(20, 2, 'R06-Fibonacci1', NULL, 'La secuencia 0 1 1 2 3 5 8 …. Se conoce con el nombre de Fibonacci, donde se parte de los valores 0 y 1 y el resto de los valores se calculan como la suma de los dos anteriores. En base a esto, se pide, dado un valor, devolver el número de la sucesión de Fibonacci que ocupa esa posición. Por ejemplo si es numero es 5, debería devolver (escribir)  EL VALOR 3', 2, 8000),
(21, 2, 'R03-Sumar Impares', NULL, 'Dado un valor N, generar y sumar la secuencia de los N primeros números impares<br/>\r\nZ = 1 + 3 + 5 + 7 + ….+ (2N -1)<br/>\r\n\r\nSi N = 5, se debería sumar 1 + 3 + 5 + 7 + 9, mostrando como resultado el valor  25.', 1, 8000),
(22, 2, 'R07-Fibonacci 2', NULL, 'Dado un valor N, mostrar la suma correspondiente a los N-valores de la sucesión de Fibonacci:<br/>\r\n\r\nZ = 0 + 1 + 1 + 2 + 3 + 5 + 8 ……..An <br/>\r\n\r\nSi N = 5, se debería sumar 0 + 1 + 1 + 2 + 3, mostrando como resultado el valor  7', 2, 8000),
(23, 1, 'Múltiplos', NULL, 'Dado dos números, indicar si el primero es múltiplo del segundo. Devolver, 1 en caso de ser verdadero y 0 en caso de ser falso.', 2, 5000),
(24, 2, 'Es Primo? falta', NULL, 'Dado un número escribir 1 si es primo o 0 en caso contrario.', 3, 10000),
(25, 2, 'Máximo Común divisor - falta', NULL, 'Leer dos números, calcular y mostrar su máximo común diviso. Ejemplo: el máximo común divisor  de 10 y 15 es: 5; es decir:  mcd(10, 15) = 5.', 3, 8000),
(26, 2, 'Mínimo Común Múltiplo - falta', NULL, 'Leer dos números, calcular y mostrar su mínimo común múltiplo. Ejemplo: el mínimo común múltiplo de 10 y 15 es:  30.\r\n\r\n', 3, 5000),
(27, 2, 'R09-Números tartamudos', NULL, 'Se dice que un número N es Tartamudo cuando alguna de sus cifras aparece al menos dos veces seguidas. Por ejemplo, son Tartamudos: 1122293, 33310. 40772, etc.\r\nDesarrollar un algoritmo que verifique si un número N es Tartamudo. Devolver, 1 en caso de ser Tartamudo y 0 en caso contrario.', 3, 10000),
(28, 2, 'R08-Números oblongos', NULL, 'Un número N se llama Oblongo si es el resultado del producto de dos números consecutivos. Por ejemplo    30 y 42 son Oblongos, ya que son el resultado del producto de 5*6 y de 6*7 respectivamente.\r\nDesarrollar un algoritmo que verifique si un número N es Oblongo.  Devolver 1 en caso afirmativo y 0 en caso contrario.', 3, 10000),
(29, 1, 'R10-Números perfectos', NULL, 'Un número N se llama Perfecto si sumando a sus divisores (sin incluirse a sí mismo) se obtiene N. Por ejemplo 6 es Perfecto, ya que sus divisores son 1, 2 y 3, y la suma da 6.\r\nDesarrollar un algoritmo que verifique si un número N es Perfecto.  Devolver 1 en caso afirmativo y 0 en caso contrario.', 3, 10000),
(30, 2, 'F15 N y M son Amigos', NULL, 'Dos números N y M son Amigos, si sumando los divisores de N obtenemos M, y sumando los divisores de M obtenemos N. En ambos casos se deben excluir N y M como divisores. Por ejemplo 220 y 284 son Amigos. Los divisores de 220 son 1, 2, 4, 5, 10, 11, 20, 22, 44, 55 y 110, que suman 284. Los divisores de 284 son 1, 2, 4, 71 y 142, que suman 220.\r\nDesarrollar un algoritmo que verifique si dos números N y M son Amigos.  Devolver 1 en caso Afirmativo y 0 en caso Contrario.', 3, 10000),
(31, 3, 'F16 Perímetro 1', '4ac187b386cc18a9499ad4bc730e0da4.jpg', 'Desarrollar un algoritmo que, dados los valores de d y b, calcule el perímetro de un rectángulo.  En caso de que el resultado de con decimales, truncar el número a la parte entera.', 2, 10000),
(32, 3, 'F208 Poligono regular', 'ec43afdcba68c6d55f3bcc6beca8474a.jpg', 'Desarrollar un algoritmo que, dados los valores de lado y &alpha;, calcule el perímetro de un polígono regular. <br/> Ejemplos: <br/> entrada: 1,  18 - salida: 20  <br/> entrada: 2,   36  - salida: 20 <br/> entrada: 1,  40 - salida: 9', 2, 10000),
(33, 2, 'R04-Suma de dígitos ', NULL, 'Desarrollar un algoritmo que dado un número, calcule la suma de sus dígitos.', 1, 10000),
(34, 1, 'F210 bisiesto', NULL, 'Desarrollar un algoritmo que, dado un año, evalúe si es bisiesto o no. De acuerdo al calendario Gregoriano un año es bisiesto si es divisible por 4, excepto aquellos divisibles por 100, que para ser bisiestos, deben ser también divisibles por 400.  Devolver 1 en caso Afirmativo y 0 en caso contrario.', 1, 10000),
(35, 1, 'F211 Capicua', NULL, 'Desarrollar un algoritmo que, dado un número de 5 cifras, verifique si es capicúa.  Devolver 1 en caso Afirmativo y 0 en caso contrario.', 2, 10000),
(36, 3, 'F212 Distancia', NULL, 'Desarrollar un algoritmo que calcule la distancia entre dos ciudades, sabiendo que un vehículo pudo recorrer esa distancia a una velocidad v (km/h) en un tiempo t (h).', 1, 10000),
(37, 3, 'JO5S Numero invertido', NULL, 'Desarrollar un algoritmo que permita invertir un número de 3 cifras. Por ejemplo, invertir a 492 da como resultado 294. ', 2, 10000),
(38, 3, 'JO10S Dígito Verificador', NULL, 'Desarrollar un algoritmo que calcule el dígito verificador de un número de cuatro cifras de la siguiente manera: <br>\r\n1. Al mayor entre el primer y último dígito, se le resta el menor.<br>\r\n2. La operación se repite entre el segundo y tercer dígito. <br>\r\n3. Se suman ambos resultados<br> \r\n4. Se obtiene el resto de dividirlo por 9.<br> \r\n<br>\r\nPor ejemplo, para el número 9371 se calcula:<br>\r\n1. Entre el primer y último dígito, el mayor es 9; a 9 se le resta 1. El resultado es 8.<br>\r\n2. Entre el segundo y tercer dígito, el mayor es 7; a 7 se le resta 3. El resultado es 4.<br>\r\n3. Se suman ambos resultados, es decir 8 + 4 = 12.<br>\r\n4. El resto de dividir 12 por 9 es 3.<br>\r\n<br>\r\nO sea, el dígito verificador vale 3.', 2, 10000),
(39, 2, 'R05-Multiplicación', NULL, 'Desarrollar un algoritmos que dados dos valores, X y N (menor a 10), calcule el producto de los N primeros números naturales a partir de X. Por ejemplo, si X vale 8 y N vale 5, el algoritmo debe devolver el resultado del producto 8*9*10*11*12, es decir, 95040. ', 2, 10000),
(40, 3, 'F216 Polígono regular ++', '2ebb133a3ec0109c18e6bc8251e223ea.jpg', 'Desarrollar un algoritmo que, dados los valores de lado y &beta;, calcule el perímetro de un polígono regular (la figura es solo para guia, puede ser cualquier poligono). <br/> Ejemplos <br/> entrada: 1, 144 - salida: 10 <br/> entrada: 5,  162 - salida: 100', 3, 10000),
(41, 3, 'F217 Area de figura', '2ac2a00fa6444919fca2efaa9b4aef83.jpg', 'Desarrollar un algoritmo que, dados los valores de AB, BC y CD, calcule el área de la figura, sabiendo que ABCE es un rectángulo y que CDE es un triángulo isósceles.  El resultado del área debe ser redondeado al entero mas cercano.', 2, 10000),
(42, 3, 'F17 Promedio de 4 números', NULL, 'Dados cuatro números enteros se debe devolver el promedio. En caso de que el resultado de con decimales, truncar el número a la parte entera.', 1, 10000),
(43, 3, 'Jugando al Chancho con Fosforos', '103f6341351f55549b496415566cf8e4.jpg', 'Un grupo de amigos suele salir de campamento, y para pasar el rato a veces juegan partidas de "chancho", un juego de cartas donde por cada mano que uno pierde,\r\nse le escribe una letra progresivamente formando la palabra chancho, y el primero que llega a tener la palabra completa pierde el partido.\r\nObviamente, gana el último que queda sin perder.\r\n\r\nDado que cuentan con mucho tiempo, y como disfrutan mucho el juego, en vez de anotar la letra completa utilizan fósforos y van anotando fósforo por fósforo hasta formar cada letra, como se ilustra en la imagen.<br/>\r\n\r\nEl problema de esto, es que cuando juegan de a varios necesitan mucha cantidad de fósforos.\r\n\r\nAyuden a estos chicos a determinar cuantos fósforos necesitan para jugar de a N jugadores al "Chancho".<br/>\r\n\r\n\r\nEntrada: Un número entero N de jugadores.<br/>\r\n\r\nSalida: El numero máximo de fósforos que necesitan\r\n', 1, 5000),
(44, 2, 'Capital en el Banco', NULL, 'Una persona desea invertir su dinero en un banco, el cual le otorga un 2% de interés mensual. Cual será la cantidad de dinero que esta persona tendrá al cabo de un año si la ganancia de cada mes es reinvertida (interés acumulado).\r\nPor ejemplo si el monto inicial es de $100, al cabo de un mes, tendrá una suma de $102. AL siguiente mes el 2% se calcula sobre el nuevo monto ($102) por lo que al cabo del segundo mes pasaría a tener $104,04. Este nuevo monto es el que se considera para calcular el  2% correspondiente al tercer mes, y asi sucesivamente.\r\n\r\nSe desea leer un valor correspondiente al dinero inicial y calcular el dinero de que se dispondrá al cabo de un año. Devolver el resultado redondeado al entero mas cercano.\r\n', 2, 5000),
(45, 1, 'JO6A Que Triangulo Es?', '8eddc42072f91e444e9ab63d1da5d55b.jpg', 'Diseñe un algoritmo que lea tres longitudes de un triángulo, calcule el perímetro y determine de que tipo de triángulo se trata entre: equilátero (si tiene tres lados iguales), isósceles (si tiene dos lados iguales) o escaleno (si tiene tres lados desiguales). <br/> Considere que para formar un triángulo se requiere que: "el lado mayor sea menor que la suma de los otros dos lados".\r\nLa salida que debe producirse es “perimetro_tipo” <br/>\r\nEjemplos: entrada: 5, 5, 5; salida: 15_equilatero\r\n<br/>\r\nentrada: 4, 3, 4; salida: 11_isosceles\r\n<br/>\r\nentrada: 3, 4, 5; salida: 12_escaleno\r\n<br/>\r\nentrada: 1, 4, 2; salida: 0_no', 2, 5000),
(46, 2, 'Multiplos Comunes', NULL, 'Diseñe un algoritmo que lea dos números (A y B) e indique cuantos múltiplos de A y de B a la vez hay en el rango (1, A*B). Por ejemplo si A=5 y B=10, la respuesta es la cantidad de múltiplos de 5 y  10 que hay en el rango (1, 50), es decir 5. Si A=6 y B=15, la respuesta es la cantidad de múltiplos de 6 y 15 que hay entre (1, 90), es decir 3. ', 2, 5000),
(47, 2, 'ContarVocales', NULL, 'Dada una cadena, contar y devolver la cantidad de vocales que hay en ella. La cadena debe considerarse en minúscula y sin acentos.\r\nEjemplo\r\nentrada: otorrinolaringologo\r\nsalida: 9', 1, 5000),
(48, 3, 'JO4S Don Pepe', NULL, 'Don Pepe es un señor que tuvo un hijo cuando tenía X1 años: Andrés; y una hija cuando tenía X2 años: Andrea. Andrés a su vez, tuvo una hija llamada Carla a sus X3 años, y Andrea tuvo a su hijo Santiago, con X4 años. Sabiendo que Don Pepe nació en el año X5 y siendo el extraño caso de que toda la familia cumple años el mismo dia ¿Cuantos años suman Santiago y Carla si ya paso su cumpleaños de este año? <br/> Ejemplo: <br/> Entrada: <br/> año de nacimiento de Don Pepe: 1936 <br/> edad de Don Pepe cuando nació Andres: 20 <br/> edad de Don Pepe cuando nació Andrea: 24 <br/> edad de Andres cuando nació Carla: 24 <br/>\r\nedad de Andrea cuando nació Santiago: 22 <br/>\r\nSalida: 68', 2, 5000),
(49, 3, 'JO3S Torneo Fútbol 5', NULL, 'Actualmente se esta jugando el Torneo de Futbol 5 Universitario en el que intervienen N equipos. Se jugó la fecha F. Cada equipo puede hacer como máximo 3 cambios por partido. Se desea saber cuál es la cantidad maxima de cambios que pueden haber ocurrido en el torneo hasta el momento. Considere que en un partido intervienen 2 equipos.', 2, 5000),
(50, 3, 'JO1S Tito el Kiosquero', NULL, 'Tito el Kiosquero, no siempre tiene suficientes monedas y billetes para dar cambio a sus clientes.  En este momento solo tiene billetes de $10 y caramelos que cuestan 1$ cada uno.\r\nDada una cantidad P de dinero, que cantidad de caramelos debe dar de vuelto además de los billetes de $10.<br/>\r\nPara una entrada de 11 la salida debe ser 1; para una entrada de 55 la salida debe ser de 5.\r\n', 1, 5000),
(51, 1, 'JO7A Eusebio', NULL, 'Eusebio es un comerciante muy afortunado que siempre tiene suficientes monedas y billetes para dar cambio a sus clientes, y asi se evita el darles caramelos. Es decir el comerciante dispone de cualquier cantidad de billetes de $50, $20, $10 y $5 y monedas de $2 y $1. Dada una cantidad P de dinero que debemos pagarle y considerando que le pagaremos únicamente con billetes de $100 ¿Cuantos billetes y monedas como mínimo debe darnos de vuelto?. La salida debe ser un número entero<br/>.Por ejempl, para una valor a pagar P = $226, se le entregarán 4 billetes de vuelto. (1 de $50, 1 de $20 y 2 monedas de $2)', 2, 10000),
(52, 3, 'JO8A 2 Puntos', NULL, 'Dados 2 puntos en el plano cartesiano, determinar la pendiente y la ordenada al origen de la recta que pasa por los 2 puntos. La salida debe tener la forma "pendiente*X+ordenada" sin espacios. <br/>Ejemplo:  para una entrada 1, 2, 2, 1 donde los valores representan los puntos (x1=1, y1=2) ; (x2=2 , y2=1), la salida debe ser "-1*X+3".<br/>\r\npara una entrada 1, 1, 2, 2 donde los valores representan los puntos (1, 1) y (2, 2); la salida debe ser "1*X+0"', 2, 5000),
(53, 2, 'JO9R Suma dígitos', NULL, 'Para un número N, entre 0 y 99999, devolver la suma de sus dígitos.', 1, 5000),
(54, 2, 'JO12R Suma Pares', NULL, 'Para dos valores N y M, calcular la suma de los valores pares entre N y M, incluyendo N y M en caso que corresponda. Se debe verificar que N < M. En el caso que N > M debe devolver 0.\r\n', 1, 5000),
(55, 2, 'JO11R Reemplaza dígito', NULL, 'Para un número N de 5 cifras y un valor K entre 2 y 5, reemplazar en N el dígito K por 0. Ejemplo: Para N=32415 y K=3, se debe obtener 32015. Para N=32415 y K=5, se debe obtener 32410.', 2, 5000),
(56, 2, 'JO14C Concatena', NULL, 'Dado un número n, y un caracter c, devolver una cadena formada por n c´s. Si n es negativo o 0 devuelve la cadena vacia. Ejemplos: 1) entrada n=5 y c="*" , salida *****, 2) entrada n= 7 y c="h", salida hhhhhhh. 3) entrada = -3 y c="A", salida "s/cadena"', 2, 5000),
(57, 2, 'JO15C Reverso', NULL, 'Dada una cadena, devolver la misma invertida. Ejemplo: entrada "abcde" , salida "edcba" - entrada "1ertu9zk" salida "kz9utre1"', 2, 5000),
(58, 2, 'JO17C Romanos', NULL, 'Dado un numero n menor a 500, devolver el mismo número en notación romana. Ejemplo: entrada 9 salida IX , entrada 417 salida CDXVII- AYUDA: 1- I, 2 - II, 3- III, 4 - IV, 5 - V, 6 - VI, 7 - VII, 8 - VIII, 9 - IX, 10- X, 50 - L, 100 - C, 500 - D', 3, 10000),
(59, 2, 'JO16C Cuenta Palíndromos', NULL, 'Palíndromos son las palabras que se leen igual al derecho que al revés. Dada una oración, determinar cuántas palabras de la misma son palíndromo. Considere que las palabras están separadas por un "_".  <br/>  Ejemplo,\r\nPara la entrada:"sos_un_gran_programador_php" la salida es:2.<br/>\r\nPara la entrada:"sos_de_neuquen_sos_de_la_patagonia", la salida es:3<br/>', 3, 10000),
(60, 2, 'JO13R Suma multiplos', NULL, 'Si listamos todos los números naturales menores que 15 que son múltiplos de 3 y de 2 tenemos: 6 y 12. La suma de estos múltiplos es 18. Se requiere un programa que dado un número natulal N devuelva la suma de todos los múltiplos de 3 y de 2 menores que N.', 3, 5000),
(61, 2, 'JOR Oblongo', NULL, 'Un número N se llama Oblongo si es el resultado del producto de dos números consecutivos. Por ejemplo 30 y 42 son Oblongos, ya que son el resultado del producto de 5*6 y de 6*7 respectivamente. Desarrollar un algoritmo que verifique si un número N es Oblongo. Devolver "N1 N2" consecutivos donde N1*N2=N.\r\nEjemplo para la entrada 20 la salida es "4 5". En caso en que N no sea Oblongo, debe devolver 0.', 3, 1000),
(62, 1, 'Nos vamos de campamento', '49cbe7f4605054ddd5e5819f18794e6b.png', 'COORDENADAS: \r\nUn grupo de amigos suele salir de campamento. La ultima vez salieron divididos en 2 grupos: A y B. \r\nComo deben saber de geografía, cualquier punto del planeta puede ser determinado unívocamente por un par de coordenadas cartesianas que indican la latitud y la longitud del punto: la latitud varía entre -90º (sur) y 90º (norte), y la longitud varia entre -180º (oeste) y 180º (este). Nos interesa averiguar cual es la ubicación relativa del grupo B respecto de A,  esto es:  determinar si B está  al Sur(S), al Norte(N), al Este(E), Oeste(O), Sudeste(SE), Sudoeste(SO), Nordeste(NE), Noroeste(NO) o si A y B están en el mismo campamento (MC). La ubicación del grupo A es -33º de latitud y -69º de longitud.<br/>\r\n\r\nLeer 2 números enteros latB y longB, (que representan latitud y longitud de la ubicación del campamento del grupo B) y devolver la cadena “S”, “N”, “E”, “O”, “SE”, “SO”, “NE”, “NO” o “MC” según corresponda. <br/>\r\nEjemplos <br/>\r\nentrada: -45, -40    /   salida: SE (ver gráfico) <br/>\r\nentrada: 3, -70    /   salida: NO  <br/>\r\nentrada: -3, -69    /   salida: N  <br/>\r\nentrada: 3, 10    /   salida: NE  <br/>\r\n', 2, 5000),
(63, 2, 'JOC Romanos II', NULL, 'Dado un numero n menor a 500 en números naturales, devolver el mismo número en romano. Ejemplo: entrada IX salida 9 , entrada CDXVII salida 417- AYUDA: 1- I, 2 - II, 3- III, 4 - IV, 5 - V, 6 - VI, 7 - VII, 8 - VIII, 9 - IX, 10- X, 50 - L, 100 - C, 500 - D', 3, 10000),
(64, 2, 'Juego con cuadrados', '456d8bef1448165d0c2a501d27b2f3b9.jpg', 'Jacinto es un carpintero que construye, entre otras cosas, juegos didácticos. Los docentes del jardin de Infantes “Chiquitines” le han encargado que arme un juego de encastre “cuadrados anidados” que consiste en figuras cuadradas huecas de distinto tamaño que deben ser ordenadas por los niños como lo muestra la figura. <br/><br/>\r\nDebemos ayudar a Jacinto a calcular cuantos cuadrados podra armar con el material que tiene. Considere que Jacinto utilizará varillas de madera para el trabajo, y que puede aprovechar todos los recortes de las varillas que vayan quedando, pudiendo pegarlas. Entonces cuantos cuadrados podrá armar, sabiendo que: <br/>\r\n-  cada cuadrado interno tiene 2 cm menos de lado que el que le sigue, (el lado de B es 2cm menor que el lado de A, y el lado de C es 2 cm menor que el de B)\r\n <br/> -  el cuadrado mas pequeño debe ser de 5 cm de lado <br/> \r\nentrada: cantidad de varillas, longitud de las varillas en cm/\r\nsalida: cantidad de cuadrados <br/>\r\nejemplo: entrada 5, 30 /  salida: 4 <br/>\r\nejemplo: entrada 2, 53 /  salida: 3 <br/>\r\n\r\n', 1, 5000),
(65, 2, 'Rotar Numero', NULL, 'Para un número N de 5 cifras y un valor K entre 2 y 5 (inclusive) , re requiere rotar N k lugares hacia la derecha. Rotar el número significa que cada dígito se mueva un lugar hacia la derecha, y el último dígito (que se cae del número) pasa a ocupar el primer lúgar, o sea el de la decena de mil. Entonces al aplicar una rotación al número  37854, se obtiene 43785. <br/>   Ejemplo: Para N=32415 y K=3, se debe obtener 41532. Para N=32415 y K=5, se debe obtener 32415', 2, 5000),
(66, 2, 'Generar numero', NULL, 'Dado un número N, 0&lt;N&lt;10, generar un número entero cuyo primer dígito sea N, y los digitos siguientes sean los menores que N en orden, hasta 0. Ejemplo, si N=5, debe generar 543210, si N=2, debe generar 210, si N=1, debe generar 10.', 2, 5000),
(67, 2, 'Generar número creciente', NULL, 'Dado un número N, 0&lt;N&lt;10, generar un número entero cuya unidad sea N, y los digitos siguientes hacia la izquierda (decena, centena, etc.) sean los menores que N en orden, hasta 1. Ejemplo, si N=5, debe generar 12345, si N=2, debe generar 12, si N=1, debe generar 1.', 2, 5000),
(68, 2, 'Calculo de horas', NULL, 'A partir de un dia, un mes, y una cantidad de horas, calcular el total de horas transcurridas desde el 1 de enero hasta el momento indicado por los datos ingresados. Considere a febrero con 28 dias. Ejemplo <br/> entrada: 12, 3, 5 /salida: 1685 (son 31 dias de enero, 28 dias de febrero, 11 dias de marzo, y 5 horas) <br/> entrada: 10, 1, 15 /salida: 231 ', 2, 5000),
(69, 3, 'El ciclista', NULL, 'Un ciclista se desplaza a velocidad constante <em> vel </em> por <em> t1 </em> seg, en ese momento acelera <em> aa </em> m/s2 durante <em> tt </em> seg. Calcular la distancia total recorrida.\r\nEjemplo: vel= 5, t1= 30,  aa= 1, tt=20, la distancia recorrida es 450 m.\r\n', 2, 5000),
(70, 2, 'Armando una casa con cartas', '478c86f778fdd993100014714455fe3c.jpg', 'Julián esta aburrido y decide entretenerse armando casas con cartas. En la figura se muestra una casa de 4 pisos, para la que se utilizaron 26 cartas. Notese que en cada piso se utilizan 3 cartas menos que en el piso de abajo (o en cada piso 3 cartas mas que en el de arriba, aunque la casa se arma de abajo hacia arriba). <br/>\r\n Debemos ayudar a Julián a saber cual es el máximo de pisos que  puede hacer con N cartas (si es muy abilidoso con las manos lo conseguirá...) <br/>\r\nEjemplos, <br/> Entrada: 26, salida: 4\r\n<br/> Entrada: 30, salida: 4\r\n<br/> Entrada: 8, salida: 2 ', 2, 5000),
(71, 2, 'Armando una casa con cartas 2', 'a8c9794abf14f28ab63a4444a3245eb8.jpg', 'Julián esta aburrido y decide entretenerse armando casas con cartas. En la figura se muestra una casa de 4 pisos, para la que se utilizaron 26 cartas. Notese que en cada piso se utilizan 3 cartas menos que en el piso de abajo (o en cada piso 3 cartas mas que en el de arriba, aunque la casa se arma de abajo hacia arriba). <br/> Debemos ayudar a Julián a calcular cuantas cartas necesitará para hacer una casa de k pisos <br/> Ejemplos, <br/> Entrada:4, salida: 26 <br/> Entrada: 3, salida: 15 <br/> Entrada: 2, salida: 7', 2, 5000),
(72, 2, 'Jugando con cartas', '08c4b98413fee113ab39f51cd38d2655.jpg', 'Julián decidio hacer una secuencia de casas con las cartas empezando por una de 2 cartas, como muestra la figura. (Ayuda,para armar solo 1 casa se necesitan 2 cartas, pero para agregar mas casas se necesitan 3 cartas por cada nueva casa, 2 para la casa y 1 para el techo que la une con la casa anterior. Por ejemplo para una casa de 4 pisos, se necesitan 26 cartas). <br/> Se desea ayudar a Julián a decidir cuantas cartas necesitará para llegar a una casa de k pisos. <br/> Ejemplos, para llegar a una casa de 2 pisos necesitará 9 cartas (2 para la primer casa y 7 para la segunda casa) <br/> para llegar a una casa de 3 pisos necesitará 24 cartas (2 para la primera, 7 para la segunda y 15 para la tercera) <br/> para llegar a una casa de 4 pisos necesitará 50 cartas.\r\n', 3, 7000),
(73, 2, 'Jugando con cartas 2', 'adb57333e40a0be22947b3f05d84f2d4.jpg', 'Julián decidio hacer una secuencia de casas con las cartas empezando por una de 2 cartas, como muestra la figura. (Ayuda,para armar solo 1 casa se necesitan 2 cartas, pero para agregar mas casas se necesitan 3 cartas por cada nueva casa, 2 para la casa y 1 para el techo que la une con la casa anteriro. Por ejemplo para una casa de 4 pisos, se necesitan 26 cartas). <br/> Se desea ayudar a Julián a decidir cuantos pisos podrá tener la última casa de la secuencia si se usan k cartas. <br/> Ejemplo, <br/> con 9 cartas la ultima casa puede tener 2 pisos <br/> con 10 cartas la ultima casa puede tener 2 pisos <br/> con 50 cartas la ultima casa puede tener 4 pisos <br/> con 53 cartas la ultima casa puede tener 4 pisos.', 3, 7000),
(74, 3, 'El aterrizaje', NULL, 'Calcular la longitud de pista, en metros, que necesita un avión para aterrizar si cuando comienza el movimiento de frenado tiene una velocidad de <em>vel </em> m/s y una aceleración de <em> aa </em> m/s2.\r\nEjemplo, para vel= 90 y aa=-3, la longitud de pista es 1350 m', 1, 5000),
(75, 3, 'Velocidad', NULL, 'Un coche que se desplaza a <em>vel </em> m/s acelera a razon de <em> aa </em>  m/s2   durante <em> tt </em> seg. Calcular la velocidad final obtenida en ese tiempo.\r\nEntrada: vel, aa, tt <br/> Salida: velocidad final', 1, 5000),
(76, 3, 'Ahí se escucha el tren', NULL, '¡Llegó el tren al alto valle! ...y por esas cosas del azar, salieron sorteados para ser los nuevos encargados de coordinar el sistema ferroviario a nivel local.\r\nClaramente lo más importante de su trabajo es asegurarse de que los trenes no sufran ningún accidente, por fortuna hay una sola formación usando las vías, por lo que mientras el tren no exceda su velocidad máxima no hay ningún riesgo.\r\n<BR/>\r\nComo segundo objetivo, dado un horario de inicio de servicio y uno de fin de servicio, y la espera para bajada y subida de pasajeros, deben tratar de dar la mayor cantidad de servicios por dia.\r\n<BR/>\r\nClaro está que el tren necesita un tiempo para alcanzar su velocidad máxima, como han visto en física:\r\n<BR/>\r\nVelocidadFinal = (Aceleración * Tiempo) - VelocidadInicial\r\n<BR/>y cuando un cuerpo está acelerando, su desplazamiento se calcula:\r\n<BR/>DistanciaRecorrida = 1/2*Aceleración*(TiempoRecorrido²)\r\n<BR/>\r\nSu objetivo es hacer un programa que para los datos indicados, calcule la máxima cantidad de servicios que se pueden dar desde Neuquén a Cipolleti. Sabemos que la distancia entre estaciones del tren es de 7600 metros, y que  el tiempo  requerido para subida y bajada de pasajeros es de 10 minutos.\r\n<BR/>\r\nDeberan leer: \r\n<BR/>horario_inicio = Hora de salida del primer servicio. (en horas)\r\n<BR/>horario_fin = Hora máxima a la que puede llegar el último servicio.(en horas)\r\n<BR/>velocidad_maxima = Velocidad Maxima a la que llega el tren.(metros/seg)\r\n<BR/>acelaración(metros/segundo²) y desaceleración (aceleración de frenado) (metros/segundo²)\r\n<BR/>\r\nY retornar la cantidad máxima de viajes de ida y vuelta que puede completar el tren en 1 día.\r\n<BR/>\r\n\r\nPista: En todos los casos pasará, que el tren en algún tramo alcanzará su velocidad máxima, la mantendrá por un tramo de longitud que deberán calcular y desacelerará con el tiempo ideal para llegar a 0m /segundo exactamente en la otra estación, esperará "tiempo_pasajeros" segundos y regresará hacia la otra estación. ', 3, 7000),
(77, 2, 'Secuencia de Collatz', NULL, 'El matemático Lothar Collatz en 1937, enunció su famosa conjetura (la conjetura de 3n+1), que hasta el dí­a de hoy no pudo ser demostrada para cualquier valor, pero tampoco se han encontrado contraejemplos.\r\n\r\nLo que dice su conjetura es que aplicando la siguiente función a un número N, en forma reiterada, eventualmente N pasa a valer 1.\r\n\r\nMientras(N <> 1){\r\n    si ( N es par)\r\n        N = N/2;\r\n    sino\r\n        N = (N*3) +1;\r\n}\r\n\r\nDe esta manera si hacemos la traza para N = 11, vemos que N toma como valores:  11 -> 34 -> 17 ->  52 -> 26 -> 13 -> 40 -> 20 -> 10 -> 5 -> 16 -> 8 -> 4 -> 2 -> 1\r\n\r\nLa longitud de la secuencia de Collatz de un número, es la cantidad de veces que se aplica esta función hasta llegar a 1.\r\nAsí  la longitud de la secuencia de un número L(x) queda dada por:\r\nL(1) = 0 <br/>\r\nL(2) = 1 + L(1) = 1 <br/>\r\nL(3) = 1 + L(10) = 1 + 1 + L(5) = 2 + 1 + L(16) = ... = 3 + 4 = 7  <br/>\r\nL(4) = 1 + L(2) = 2 <br/>\r\n...\r\nL(8) = 3\r\n\r\n<br/>\r\nSu desafí­o es escribir un programa que dado un número natural N, calcule la longitud de su secuencia de Collatz.\r\n', 2, 5000);
